package com.javier;

public class MorganAndString {


    public static void main(String[] args) {
        String a = "ZZZCZZZA";
        String b = "ZZZAZZB";
        String actual = morganAndString(a,b);
//        String expected = "";

        System.out.println(actual);
//        compareDifferences(actual, expected);
    }

    // Complete the morganAndString function below.
    static String morganAndString(String a, String b) {
        int aIndex = 0;
        int bIndex = 0;
        StringBuilder builder = new StringBuilder();
        int aTempIndex = 0;
        int bTempIndex = 0;

        while(builder.toString().length() < a.length() + b.length()) {

            if(a.charAt(aIndex) > b.charAt(bIndex)) {
                builder.append(b.charAt(bIndex));
                bIndex++;
            } else if (a.charAt(aIndex) < b.charAt(bIndex)){
                builder.append(a.charAt(aIndex));
                aIndex++;
            } else  {
                aTempIndex = aIndex;
                bTempIndex = bIndex;

                while (a.charAt(aTempIndex) == b.charAt(bTempIndex)) {
                    aTempIndex++;
                    bTempIndex++;
                    if(aTempIndex < a.length() && bTempIndex < b.length()){
                        if(a.charAt(aTempIndex) < b.charAt(bTempIndex)) {
                            builder.append(a.substring(aIndex, aTempIndex));
                            aIndex = aTempIndex;
                            break;
                        } else if (a.charAt(aTempIndex) > b.charAt(bTempIndex)) {
                            builder.append(b.substring(bIndex, bTempIndex));
                            bIndex = bTempIndex;
                            break;
                        }
                    }

                    if(aTempIndex == a.length() || bTempIndex == b.length()){
                        break;
                    }
                }

                if (aTempIndex == a.length()){
                    builder.append(a.charAt(aIndex));
                    aIndex++;
                } else if (bTempIndex == b.length()){
                    builder.append(b.charAt(aIndex));
                    bIndex++;
                }

            }

            if(bIndex == b.length()){
                builder.append(a.substring(aIndex));
            }

            if(aIndex == a.length()){
                builder.append(b.substring(bIndex));
            }
        }
        return builder.toString();
    }


    static void compareDifferences (String actual, String expected){
        System.out.println(actual.length()==expected.length());

        for (int i = 0; i < actual.length() ; i++) {
            if (actual.charAt(i) != expected.charAt(i)) {
                System.out.println("Actual: " + actual.charAt(i));
                System.out.println("Expected: " + expected.charAt(i));
                System.out.println("Index: " + i);
                System.out.println();
                break;
            }
        }
    }
}
